kled-\r\n?	Built an industry leading highly scalable and parallel data processing engine, that can process data of order of Terabytes per day\r\n?	Designed & developed  complex  algorithms in the area pattern matching, cleansing, address  validation and identity matching etc. for data quality and data governance\r\n?	Built an ultra-low latency message platform\r\n?	Universal connectivity to all data sources\r\n?	Built a complex event processing engine\r\n?	Built a highly scalable data replication engine\r\n?	Real time processing & messaging\r\n?	Parsing & transforming complex & unstructured data\r\n\r\nHere are the technologies/domain you get to work on:\r\n?	SOA/Web-Services\r\n?	Hadoop, HDFS, Hive, Map/reduce\r\n?	Cloud Computing/ Software as a Service\r\n?	Grid, High availability, Optimization, Real Time\r\n?	Semantic inference, Ontology\r\n?	Model Driven Architecture\r\n?	Complex Event Processing\r\n?	Ultra Low latency messaging\r\n?	Scalable Spill to disk B-Tree based cache component\r\n?	Massive scale components and services for data processing \r\n?	Multi-modality to solve all forms of integration \r\n?	Multi-cloud runtime that spans across private and public cloud with dynamic and elastic provision \r\n?	Optimizer \r\n?	Load balancing among compute node that spans private and public cloud \r\n?	Multi-tenancy for compute and failure isolation \r\n?	Platform SDK \r\n?	Thick and thin client UI environment for design and development \r\n?	Connectivity for cloud data system and Social media \r\n?	Data manipulation language for all data types including relation, hierarchical, un/semi structured, user-defined composite type',' ','',6.5,1,'100000','0','0',60,60,940000,0,0,0,0,0),(111,'Flipkart India Pvt Ltd.-Flipkart-GT',138,NULL,NULL,0,0,0,0,0,12.55,0,NULL,0,'0','Bangalore','Graduate Trainee','Graduate Trainee',' ','',7,1,'0','0','0',60,60,12.55,0,0,0,0,0),(112,'Godrej Agrovet Limited-Executive',140,NULL,NULL,3,0,0,0,0,4,0,NULL,0,'0','Plant facilities all over Indi